import L from 'leaflet';

const iconCompost = new L.Icon({
    iconUrl: require('../img/leaf-green.png'),
    iconRetinaUrl: require('../img/leaf-green.png'),
    iconAnchor: [12, 41],
    popupAnchor: null,
    shadowUrl: ('../img/leaf-shadow.png'),
    shadowSize: [30, 44],
    shadowAnchor: [12, 41],
    iconSize: [18, 65],
    className: 'leaflet-div-icon'
});

export { iconCompost };
